INSERT INTO `v1_22217653c064d7980edcdb6d8574f6057e7f6074ccd812cba2dc78120411847d` VALUES ("---", 2, "", "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 1, 0, "アサヒ", 3, 1, 6000);
INSERT INTO `v1_22217653c064d7980edcdb6d8574f6057e7f6074ccd812cba2dc78120411847d` VALUES ("アドレナリン", 3, "ホームランを連発すると、連発数に応じてパワーアップする", "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 3, 3, "部員3", 0, 1, 16000);
INSERT INTO `v1_22217653c064d7980edcdb6d8574f6057e7f6074ccd812cba2dc78120411847d` VALUES ("ラッキー", 4, "幸運のハプニングを呼び込む", "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 2, 2, "{0}", 2, 1, 30000);
INSERT INTO `v1_22217653c064d7980edcdb6d8574f6057e7f6074ccd812cba2dc78120411847d` VALUES ("", 5, "", "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", 0, 1, "選手名鑑 おまけページ", 1, 0, 50000);
